var sandwich = function sandwich() {
  var sandwichButton = document.querySelector('.sandwich__open-btn');
  var sandwichClose = document.querySelector('.main-nav__close');
  var menu = document.querySelector('.main-nav');
  sandwichButton.addEventListener('click', function () {
    menu.classList.add('main-nav--opened');
  });
  sandwichClose.addEventListener('click', function () {
    menu.classList.remove('main-nav--opened');
  });
};

$('input[type=range]').on('input', function (e) {
  var min = e.target.min,
      max = e.target.max,
      val = e.target.value;
  $(e.target).css({
    backgroundSize: "".concat((val - min) * 100 / (max - min), "% 100%")
  });
}).trigger('input');
sandwich();
